  this.breakDown_ = 0;
  if (isWideScreen) {
    this.breakDown_ |= Covariance.BreakDown.WIDE_SCREEN;
  }
  if (isHorizontal) {
    this.breakDown_ |= Covariance.BreakDown.HORIZONTAL;
  }
  if (isA11y) {
    this.breakDown_ |= Covariance.BreakDown.A11Y;
  }
