  var cost = new Date().getTime() - startInMs;
  var msg = tickName + '  -  ' + cost;
  if (opt_msg) {
    msg += '  -  ' + opt_msg;
  }
  console.log(msg);
  i18n.input.chrome.Statistics.getInstance().recordLatency(
      'InputMethod.VirtualKeyboard.InitLatency.' + tickName, cost);
